      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function closeCancelModal() {\r\n");
      out.write("        document.getElementById('cancelModal').style.display = 'none';\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    // Payment Modal Functions\r\n");
      out.write("    function openPaymentModal(bookingId, customerEmail, roomId, calculatedFine, overdueDays, dailyFine) {\r\n");
      out.write("        // Set form values\r\n");
      out.write("        document.getElementById('bookingId').value = bookingId;\r\n");
      out.write("        document.getElementById('customerEmail').value = customerEmail;\r\n");
      out.write("        document.getElementById('roomId').value = roomId;\r\n");
      out.write("        document.getElementById('calculatedFine').value = calculatedFine;\r\n");
      out.write("        document.getElementById('overdueDays').value = overdueDays;\r\n");
      out.write("\r\n");
      out.write("        // Display values\r\n");
      out.write("        document.getElementById('displayOverdueDays').textContent = overdueDays;\r\n");
      out.write("        document.getElementById('displayDailyFine').textContent = formatCurrency(dailyFine);\r\n");
      out.write("        document.getElementById('displayCalculatedFine').textContent = formatCurrency(calculatedFine);\r\n");
      out.write("        document.getElementById('displayTotalFine').textContent = formatCurrency(calculatedFine);\r\n");
      out.write("\r\n");
      out.write("        // Show modal\r\n");
      out.write("        document.getElementById('paymentModal').style.display = 'flex';\r\n");
      out.write("\r\n");
      out.write("        // Auto-select credit card by default\r\n");
      out.write("        setTimeout(() => {\r\n");
      out.write("            selectPaymentMethod('credit_card');\r\n");
      out.write("        }, 100);\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function closeModal() {\r\n");
